import React, { Component } from 'react';
import { MENU_LINKS } from './constants';
import './index.scss';
export default class NavigationMenu extends Component {
  render() {
    return (
      <div className="navigation-menu">
        {MENU_LINKS.map(link => (
          <div className="link">{link.title}</div>
        ))}
      </div>
    );
  }
}
